(14, '550f961547314.jpg', 'Kepala SKK Migas Tinjau Lapangan dan Fasilitas Migas di Kalimantan', 'Kepala SKK Migas Amien Sunaryadi baru-baru ini melakukan kunjungan lapangan ke fasilitas operasi industri hulu migas di Kalimantan Timur. Kunjungan tersebut berlangsung dari Senin (16/3) sampai dengan Selasa (17/3)', '<p style="line-height:24px;margin-bottom:15px;font-size:16px;color:rgb(75,75,75);font-family:Lucida, helvetica, sans-serif;"><br></p>', 'Kepala SKK Migas Tinjau Lapangan dan Fasilitas Migas di Kalimantan', 'Kepala SKK Migas Amien Sunaryadi baru-baru ini melakukan kunjungan lapangan ke fasilitas operasi industri hulu migas di Kalimantan Timur. Kunjungan tersebut berlangsung dari Senin (16/3) sampai dengan Selasa (17/3)', '<p style="margin-bottom:15px;"><br></p>', 'http://www.skkmigas.go.id/kepala-skk-migas-tinjau-lapangan-dan-fasilitas-migas-di-kalimantan', 1, 3, 1, 1, '0003-03-15 17:23:00', '2015-04-11 15:46:14'),
(15, '5510f746338de.jpg', 'Pemerintah Umumkan Pemenang Tender 11 Wilayah Kerja', 'Jakarta???Kementerian Energi dan Sumber Daya Mineral (ESDM) telah mengumumkan pemenang tender 11 wilayah kerja minyak dan gas bumi baru, Rabu (18/3). Dalam siaran persnya, Kementerian ESDM menyampaikan bahwa sebelas pemenang lelang tersebut menjanjikan komitmen pasti eksplorasi sebesar US$144,25 juta dengan bonus tanda tangan (signature bonus) yang diterima langsung oleh pemerintah mencapai US$12 juta.', '<p>.</p>', 'Pemerintah Umumkan Pemenang Tender 11 Wilayah Kerja', 'Jakarta???Kementerian Energi dan Sumber Daya Mineral (ESDM) telah mengumumkan pemenang tender 11 wilayah kerja minyak dan gas bumi baru, Rabu (18/3). Dalam siaran persnya, Kementerian ESDM menyampaikan bahwa sebelas pemenang lelang tersebut menjanjikan komitmen pasti eksplorasi sebesar US$144,25 juta dengan bonus tanda tangan (signature bonus) yang diterima langsung oleh pemerintah mencapai US$12 juta.', '<p>.</p>', 'http://www.skkmigas.go.id/pemerintah-umumkan-pemenang-tender-11-wilayah-kerja', 1, 4, 1, 94, '0000-00-00 00:00:00', '0004-01-15 15:04:00'),
(17, '551a3fcfea9ef.jpg', 'Menteri ESDM Optimis Target Produksi Banyu Urip Tidak Terganggu', 'Jakarta: Menteri Energi dan Sumber Daya Mineral (ESDM) Sudirman Said mengatakan optimis Lapangan Banyu Urip, Blok Cepu, akan mampu memenuhi target produksi yang diharapkan. Pernyataan ini disampaikan dalam konferensi pers, Kamis (26/6), ', '<p><br></p>', 'Menteri ESDM Optimis Target Produksi Banyu Urip Tidak Terganggu', 'Jakarta: Menteri Energi dan Sumber Daya Mineral (ESDM) Sudirman Said mengatakan optimis Lapangan Banyu Urip, Blok Cepu, akan mampu memenuhi target produksi yang diharapkan. Pernyataan ini disampaikan dalam konferensi pers, Kamis (26/6), ', '<p><br></p>', 'http://www.skkmigas.go.id/menteri-esdm-optimis-target-produksi-banyu-urip-tidak-terganggu', 1, 5, 21, 94, '0000-00-00 00:00:00', '0004-07-15 15:04:00'),
(18, '551a404f69c17.jpg', 'Kepala SKK Migas Kunjungi Kontraktor KKS Wilayah Sumatera Bagian Utara', 'Pekanbaru???Kepala Satuan Kerja Khusus Pelaksana Kegiatan Usaha Hulu Minyak dan Gas Bumi (SKK Migas) Amien Sunaryadi melakukan kunjungan kerja ke beberapa Kontraktor Kontrak Kerja Sama (Kontraktor KKS) yang beroperasi di wilayah Sumatera Bagian Utara. Kunjungan kerja tersebut berlangsung dari tanggal 12-13 Maret 2015. ', '<p><br></p>', 'Kepala SKK Migas Kunjungi Kontraktor KKS Wilayah Sumatera Bagian Utara', 'Pekanbaru???Kepala Satuan Kerja Khusus Pelaksana Kegiatan Usaha Hulu Minyak dan Gas Bumi (SKK Migas) Amien Sunaryadi melakukan kunjungan kerja ke beberapa Kontraktor Kontrak Kerja Sama (Kontraktor KKS) yang beroperasi di wilayah Sumatera Bagian Utara. Kunjungan kerja tersebut berlangsung dari tanggal 12-13 Maret 2015. ', '<p><br></p>', 'http://www.skkmigas.go.id/kepala-skk-migas-kunjungi-kontraktor-kks-wilayah-sumatera-bagian-utara', 1, 6, 94, 94, '0000-00-00 00:00:00', '0004-01-15 15:00:00'),
(19, NULL, ' Kepala SKK Migas Kunjungi Bravo Flowstation', 'Karawang???Kepala Satuan Kerja Khusus Pelaksana Kegiatan Usaha Hulu Minyak dan Gas Bumi (SKK Migas) Amien Sunaryadi telah melakukan kunjungan kerja ke Bravo Flowstation di di Blok Offshore North West Java (ONWJ), Minggu (8/3). Kunjungan tersebut juga diikuti oleh Deputi Pengendalian Operasi SKK Migas Muliawan dan Kepala Bagian Hubungan Masyarakat SKK Migas Rudianto Rimbono. ', '<p><br></p>', ' Kepala SKK Migas Kunjungi Bravo Flowstation', 'Karawang???Kepala Satuan Kerja Khusus Pelaksana Kegiatan Usaha Hulu Minyak dan Gas Bumi (SKK Migas) Amien Sunaryadi telah melakukan kunjungan kerja ke Bravo Flowstation di di Blok Offshore North West Java (ONWJ), Minggu (8/3). Kunjungan tersebut juga diikuti oleh Deputi Pengendalian Operasi SKK Migas Muliawan dan Kepala Bagian Hubungan Masyarakat SKK Migas Rudianto Rimbono. ', '<p><br></p>', 'http://www.skkmigas.go.id/kepala-skk-migas-kunjungi-bravo-flowstation', 1, 7, 94, 94, '0000-00-00 00:00:00', '0004-01-15 14:58:00'),
(20, '551a49073455b.jpg', ' PHE Metan Tanjung II Tajak Sumur Pilot CBM', 'PT Pertamina Hulu Energi (PHE) Metan Tanjung II kembali melaksanakan pemboran sumur di Kabupaten Tabalong Provinsi Kalimantan Selatan, Selasa (17/2). Pemboran sumur yang dilakukan pada awal Tahun 2015 ini merupakan pemboran sumur pilot dengan metoda multi-well production pilots on tight spacing (five-spot production pilot). ', '<p><br></p>', ' PHE Metan Tanjung II Tajak Sumur Pilot CBM', 'PT Pertamina Hulu Energi (PHE) Metan Tanjung II kembali melaksanakan pemboran sumur di Kabupaten Tabalong Provinsi Kalimantan Selatan, Selasa (17/2). Pemboran sumur yang dilakukan pada awal Tahun 2015 ini merupakan pemboran sumur pilot dengan metoda multi-well production pilots on tight spacing (five-spot production pilot). ', '<p><br></p>', 'http://www.skkmigas.go.id/phe-metan-tanjung-ii-tajak-sumur-pilot-cbm', 1, 8, 94, 94, '0000-00-00 00:00:00', '0004-01-15 15:08:00'),
(21, '551a4979eb5db.jpg', 'KEPALA SKK MIGAS KUNJUNGI LNG TANGGUH', 'Jakarta???Kepala SKK MigaS Amien Sunaryadi telah berkunjung ke fasilitas pengolahan gas alam cair (LNG) Tangguh di Teluk Bintuni, Papua Barat pada hari Jumat (27/2). . ', '<p><br></p>', 'KEPALA SKK MIGAS KUNJUNGI LNG TANGGUH', 'Jakarta???Kepala SKK MigaS Amien Sunaryadi telah berkunjung ke fasilitas pengolahan gas alam cair (LNG) Tangguh di Teluk Bintuni, Papua Barat pada hari Jumat (27/2). . ', '<p><br></p>', 'http://www.skkmigas.go.id/kepala-skk-migas-kunjungi-lng-tangguh', 1, 9, 94, 94, '0000-00-00 00:00:00', '0004-01-15 15:09:00'),
(22, '552a62bdd9630.jpg', 'Tantangan SCM Hulu Migas: Legalitas dan Penguatan SDM Menjadi Kunci', 'Patut diakui bahwa saat ini keberadaan dan peran manajemen rantai suplai semakin strategis di hampir semua industri. Hal ini tidak lepas dengan keberadaannya yang menguasai sebagian besar biaya perusahaan, bahkan mencapai 60-70 persen pembiayaan.', '<p><br></p>', 'Tantangan SCM Hulu Migas: Legalitas dan Penguatan SDM Menjadi Kunci', 'Patut diakui bahwa saat ini keberadaan dan peran manajemen rantai suplai semakin strategis di hampir semua industri. Hal ini tidak lepas dengan keberadaannya yang menguasai sebagian besar biaya perusahaan, bahkan mencapai 60-70 persen pembiayaan.', '<p><br></p>', 'http://www.indopetronews.com/2014/05/tantangan-scm-hulu-migas-legalitas-dan.html?m=1', 1, 2, 94, 1, '0000-00-00 00:00:00', '2015-04-12 19:19:09'),
(23, '551bac3f35a90.jpg', ' SKK MIGAS DAN 71 KONTRAKTOR KKS TERIMA APRESIASI EITI', 'Jakarta ??? The Coordinating Ministry for Economic Affairs of the Republic of Indonesia presented the Special Working Unit for Upstream Oil & Gas Business Activities (???SKK Migas??) and 71 Contractors of Cooperation Contract (???KKKS??) ', '<p><br></p>', ' SKK MIGAS DAN 71 KONTRAKTOR KKS TERIMA APRESIASI EITI', 'Jakarta ??? The Coordinating Ministry for Economic Affairs of the Republic of Indonesia presented the Special Working Unit for Upstream Oil & Gas Business Activities (???SKK Migas??) and 71 Contractors of Cooperation Contract (???KKKS??) ', '<p><br></p>', 'http://www.skkmigas.go.id/skk-migas-dan-71-kontraktor-kks-terima-apresiasi-eiti', 1, 10, 94, 94, '0004-01-15 15:25:00', '0004-01-15 15:28:00'),
(24, '551bac59829b5.jpg', ' Menteri ESDM Saksikan Serah Terima Jabatan Pimpinan SKK Migas', 'Jakarta???Pelaksana Tugas Kepala SKK Migas J. Widjonarko melakukan serah terima jabatan kepada Kepala SKK Migas yang baru Amien Sunaryadi pada hari Jumat (21/11). Serah terima jabatan ini disaksikan oleh Menteri ESDM Sudirman Said. ???Ini peristiwa penting untuk memberikan suatu kepastian mengenai organisasi SKK Migas,??', '<p><br></p>', ' Menteri ESDM Saksikan Serah Terima Jabatan Pimpinan SKK Migas', 'Jakarta???Pelaksana Tugas Kepala SKK Migas J. Widjonarko melakukan serah terima jabatan kepada Kepala SKK Migas yang baru Amien Sunaryadi pada hari Jumat (21/11). Serah terima jabatan ini disaksikan oleh Menteri ESDM Sudirman Said. ???Ini peristiwa penting untuk memberikan suatu kepastian mengenai organisasi SKK Migas,??', '<p><br></p>', 'http://www.skkmigas.go.id/menteri-esdm-saksikan-serah-terima-jabatan-pimpinan-skk-migas', 1, 11, 94, 94, '0004-01-15 15:27:00', '0004-01-15 15:29:00'),
(25, '551bbcdf09d1b.jpg', ' Peringati Sumpah Pemuda, SKK Migas Gelar Bedah Buku dan Kuliah Umum', 'Samarinda???Kantor perwakilan SKK Migas wilayah Kalimantan dan Sulawesi bekerja sama dengan Lingkar Studi Mahasiswa (LISUMA) Kalimantan Timur menggelar bedah buku ???Nasionalisme Migas?? di Universitas Mulawarman', '<p><br></p>', ' Peringati Sumpah Pemuda, SKK Migas Gelar Bedah Buku dan Kuliah Umum', 'Samarinda???Kantor perwakilan SKK Migas wilayah Kalimantan dan Sulawesi bekerja sama dengan Lingkar Studi Mahasiswa (LISUMA) Kalimantan Timur menggelar bedah buku ???Nasionalisme Migas?? di Universitas Mulawarman', '<p><br></p>', 'http://www.skkmigas.go.id/peringati-sumpah-pemuda-skk-migas-gelar-bedah-buku-dan-kuliah-umum', 1, 12, 94, 94, '0004-01-15 16:39:00', '0004-01-15 17:20:00'),
(26, '551bc2093eea1.jpg', ' SKK Migas dan Kodam VI Mulawarman Koordinasi Pengamanan Jalur Pipa Migas', 'Samarinda???Satuan Kerja Khusus Pelaksana Kegiatan Usaha Hulu Minyak dan Gas Bumi (SKK Migas) Perwakilan Kalimantan dan Sulawesi dan Kodam VI Mulawarman kembali melaksanakan survei lapangan terhadap jalur pipa migas yang merupakan obyek vital nasional', '<p><br></p>', ' SKK Migas dan Kodam VI Mulawarman Koordinasi Pengamanan Jalur Pipa Migas', 'Samarinda???Satuan Kerja Khusus Pelaksana Kegiatan Usaha Hulu Minyak dan Gas Bumi (SKK Migas) Perwakilan Kalimantan dan Sulawesi dan Kodam VI Mulawarman kembali melaksanakan survei lapangan terhadap jalur pipa migas yang merupakan obyek vital nasional', '<p><br></p>', 'http://www.skkmigas.go.id/skk-migas-dan-kodam-vi-mulawarman-koordinasi-pengamanan-jalur-pipa-migas', 1, 13, 94, 94, '0004-01-15 17:01:00', '0004-01-15 17:20:00'),
(27, '551bc6f848173.jpg', 'DPRD Kukar Kunjungi SKK Migas Kalsul', 'Balikpapan??? Anggota Komisi III DPRD Kutai Kartanegara yang baru saja dilantik, mengunjungi kantor SKK Migas Kalsul, di Balikpapan (8/10). Kehadiran rombongan DPRD Kukar tersebut di sambut oleh Kepala Operasi SKK Migas Kalsul Roy Widhiarta bersama staf SKK Migas Kalsul.', '<p><br></p>', 'DPRD Kukar Kunjungi SKK Migas Kalsul', 'Balikpapan??? Anggota Komisi III DPRD Kutai Kartanegara yang baru saja dilantik, mengunjungi kantor SKK Migas Kalsul, di Balikpapan (8/10). Kehadiran rombongan DPRD Kukar tersebut di sambut oleh Kepala Operasi SKK Migas Kalsul Roy Widhiarta bersama staf SKK Migas Kalsul.', '<p><br></p>', 'http://www.skkmigas.go.id/dprd-kukar-kunjungi-skk-migas-kalsul', 1, 14, 94, 94, '0004-01-15 17:22:00', '0004-01-15 17:26:00'),
(28, '551cb5ecadad8.jpg', 'SKK Migas-PTTEP Bantu Gedung SIOLA', 'Mamuju??? SKK Migas dan Kontraktor KKS PTT Exploration & Production (PTTEP) menyerahkan bantuan gedung Stimulasi Intervensi Optimalisasi Layanan Anak (SIOLA) pada pemerintah Mamuju, Sulawesi Barat. Peresmian secara simbolik gedung ini dilaksanakan Rabu (8/10) dan dihadiri oleh Gubernur Sulawesi Barat Anwar Adnan Saleh Bupati Mamuju Suhardi Duka, ', '<p><br></p>', 'SKK Migas-PTTEP Bantu Gedung SIOLA', 'Mamuju??? SKK Migas dan Kontraktor KKS PTT Exploration & Production (PTTEP) menyerahkan bantuan gedung Stimulasi Intervensi Optimalisasi Layanan Anak (SIOLA) pada pemerintah Mamuju, Sulawesi Barat. Peresmian secara simbolik gedung ini dilaksanakan Rabu (8/10) dan dihadiri oleh Gubernur Sulawesi Barat Anwar Adnan Saleh Bupati Mamuju Suhardi Duka, ', '<p><br></p>', 'http://www.skkmigas.go.id/skk-migas-pttep-bantu-gedung-siola', 1, 15, 94, 94, '0004-02-15 10:22:00', '0004-02-15 10:28:00'),
(29, '551cb7a68de0f.jpg', 'PRESIDEN SUSILO BAMBANG YUDHOYONO MERESMIKAN FASILITAS PRODUKSI LAPANGAN BANYU URIP', 'SURABAYA ??? Presiden Republik Indonesia, Susilo Bambang Yudhoyono hari ini (7/10) meresmikan Fasilitas Produksi Lapangan Banyu Urip. Presiden menandatangani prasasti peresmian Fasilitas Produksi Lapangan Banyu Urip setelah menghadiri puncak peringatan Hari Jadi TNI di Surabaya', '<p><br></p>', 'PRESIDEN SUSILO BAMBANG YUDHOYONO MERESMIKAN FASILITAS PRODUKSI LAPANGAN BANYU URIP', 'SURABAYA ??? Presiden Republik Indonesia, Susilo Bambang Yudhoyono hari ini (7/10) meresmikan Fasilitas Produksi Lapangan Banyu Urip. Presiden menandatangani prasasti peresmian Fasilitas Produksi Lapangan Banyu Urip setelah menghadiri puncak peringatan Hari Jadi TNI di Surabaya', '<p><br></p>', 'http://www.skkmigas.go.id/presiden-susilo-bambang-yudhoyono-meresmikan-fasilitas-produksi-lapangan-banyu-urip', 1, 16, 94, 94, '0004-02-15 10:29:00', '0004-02-15 10:31:00'),
(30, '551cb84bc7bcd.jpg', ' JOB Pertamina Medco E&P Simenggaris Siap Bor Satu Sumur Di Nunukan', 'Nunukan ??? JOB Pertamina Medco E&P Simenggaris siap mengebor satu sumur eksplorasi South East Sembakung (SES) #1 di Desa Tepian, Kecamatan Sembakung, Nunukan pada awal tahun 2015.', '<p><br></p>', ' JOB Pertamina Medco E&P Simenggaris Siap Bor Satu Sumur Di Nunukan', 'Nunukan ??? JOB Pertamina Medco E&P Simenggaris siap mengebor satu sumur eksplorasi South East Sembakung (SES) #1 di Desa Tepian, Kecamatan Sembakung, Nunukan pada awal tahun 2015.', '<p><br></p>', 'http://www.skkmigas.go.id/job-pertamina-medco-ep-simenggaris-siap-bor-satu-sumur-di-nunukan', 1, 17, 94, 94, '0004-02-15 10:32:00', '0004-02-15 10:34:00'),
(31, '551cb93d10b08.png', 'MENTERI ESDM MERESMIKAN NAMA FSO GAGAK RIMANG', 'SINGAPURA ??? Perkembangan proyek minyak dan gas bumi (migas) Banyu Urip, Blok Cepu yang terletak di Bojonegoro, Jawa Timur, hingga minggu ketiga Agustus 2014 ini mencapai 90 persen.', '<p><br></p>', 'MENTERI ESDM MERESMIKAN NAMA FSO GAGAK RIMANG', 'SINGAPURA ??? Perkembangan proyek minyak dan gas bumi (migas) Banyu Urip, Blok Cepu yang terletak di Bojonegoro, Jawa Timur, hingga minggu ketiga Agustus 2014 ini mencapai 90 persen.', '<p><br></p>', 'http://www.skkmigas.go.id/menteri-esdm-meresmikan-nama-fso-gagak-rimang', 1, 18, 94, 94, '0004-02-15 10:36:00', '0004-02-15 10:39:00'),
(32, '551d089abaf39.png', 'KOMITMEN IMPLEMENTASI TATA KELOLA YANG BAIK', 'Sebagai komitmen penerapan prinsip-prinsip Good Governance dan sesuai Pedoman Etika dan Pedoman Pengendalian Gratifikasi, Seluruh Pimpinan dan Pekerja Satuan Kerja Khusus Pelaksana Kegiatan Usaha Hulu Minyak dan Gas Bumi (SKK Migas) beserta keluarganya,', '<p><br></p>', 'KOMITMEN IMPLEMENTASI TATA KELOLA YANG BAIK', 'Sebagai komitmen penerapan prinsip-prinsip Good Governance dan sesuai Pedoman Etika dan Pedoman Pengendalian Gratifikasi, Seluruh Pimpinan dan Pekerja Satuan Kerja Khusus Pelaksana Kegiatan Usaha Hulu Minyak dan Gas Bumi (SKK Migas) beserta keluarganya,', '<p><br></p>', 'http://www.skkmigas.go.id/komitmen-implementasi-tata-kelola-yang-baik', 1, 19, 94, 94, '0004-02-15 16:15:00', '0004-02-15 16:18:00'),
(33, '551d09955340f.jpg', 'Murphy Oil Mulai Tajak Sumur Eksplorasi Serai-1', 'Fak-Fak, Papua Barat -  Murphy Semai Oil Co. Ltd., telah mulai melakukan tajak dua sumur eksplorasi yaitu Serai-1 dan  Bawang Putih-1 di Blok Semai II, Papua Barat. Saat ini Murphy Oil telah mulai melakukan tajak sumur Serai-1 di lepas pantai Kabupaten Fak-Fak', '<p><br></p>', 'Murphy Oil Mulai Tajak Sumur Eksplorasi Serai-1', 'Fak-Fak, Papua Barat -  Murphy Semai Oil Co. Ltd., telah mulai melakukan tajak dua sumur eksplorasi yaitu Serai-1 dan  Bawang Putih-1 di Blok Semai II, Papua Barat. Saat ini Murphy Oil telah mulai melakukan tajak sumur Serai-1 di lepas pantai Kabupaten Fak-Fak', '<p><br></p>', 'http://www.skkmigas.go.id/murphy-oil-mulai-tajak-sumur-eksplorasi-serai-1', 1, 20, 94, 94, '0004-02-15 16:17:00', '0004-02-15 16:19:00'),
