(59, '5524a21a59fe6.jpg', ' Industri Hulu Migas Peduli Korban Sinabung', 'Karo ??? Industri hulu minyak dan gas bumi (migas) memberi bantuan senilai Rp 1,1 miliar kepada korban bencana letusan Gunung Sinabung, Kabupaten Karo, Sumatera Utara. Bantuan secara simbolis diserahkan Deputi Pengendalian Dukungan Bisnis, Satuan Kerja Khusus Pelaksana Kegiatan Usaha Hulu Minyak dan Gas Bumi (SKK Migas),', '<p><br /></p>', ' Industri Hulu Migas Peduli Korban Sinabung', 'Karo ??? Industri hulu minyak dan gas bumi (migas) memberi bantuan senilai Rp 1,1 miliar kepada korban bencana letusan Gunung Sinabung, Kabupaten Karo, Sumatera Utara. Bantuan secara simbolis diserahkan Deputi Pengendalian Dukungan Bisnis, Satuan Kerja Khusus Pelaksana Kegiatan Usaha Hulu Minyak dan Gas Bumi (SKK Migas),', '<p><br /></p>', 'http://www.skkmigas.go.id/industri-hulu-migas-peduli-korban-sinabung', 1, 46, 94, NULL, '0004-08-15 10:35:00', NULL),
(60, '5524a27df1ea3.jpg', 'SKK MIGAS PERWAKILAN JABAMANUSA ADAKAN RAPAT BERKALA', 'SKK Migas Perwakilan Jawa, Bali, Madura dan Nusa Tenggara (Jabamanusa) dan KKKS bersama Pemerintah Daerah se-Jawa Tengah, Jawa Timur, Bali, dan Nusa Tenggara melakukan rapat berkala 25-26 September 2013 di Bandung', '<p><br /></p>', 'SKK MIGAS PERWAKILAN JABAMANUSA ADAKAN RAPAT BERKALA', 'SKK Migas Perwakilan Jawa, Bali, Madura dan Nusa Tenggara (Jabamanusa) dan KKKS bersama Pemerintah Daerah se-Jawa Tengah, Jawa Timur, Bali, dan Nusa Tenggara melakukan rapat berkala 25-26 September 2013 di Bandung', '<p><br /></p>', 'http://www.skkmigas.go.id/skk-migas-perwakilan-jabamanusa-adakan-rapat-berkala', 1, 47, 94, NULL, '0004-08-15 10:37:00', NULL),
(61, '5524a2d0d172f.jpg', 'PHE ONW Lakukan Deck Raising di LIMA Flowstation', 'Kontraktor Kontrak Kerja Sama (Kontraktor KKS) Pertamina Hulu Energi Offshore North West Java (PHE ONWJ) telah melaksanakan pengangkatan Deck/Deck Raising yang kedua pada LIMA Subsidence Remediation Project pada hari Rabu (19/9).  ', '<p><br /></p>', 'PHE ONW Lakukan Deck Raising di LIMA Flowstation', 'Kontraktor Kontrak Kerja Sama (Kontraktor KKS) Pertamina Hulu Energi Offshore North West Java (PHE ONWJ) telah melaksanakan pengangkatan Deck/Deck Raising yang kedua pada LIMA Subsidence Remediation Project pada hari Rabu (19/9).  ', '<p><br /></p>', 'http://www.skkmigas.go.id/phe-onw-lakukan-deck-raising-di-lima-flowstation', 1, 48, 94, NULL, '0004-08-15 10:38:00', NULL),
(62, '5524a32a2ccb7.jpg', 'Fasilitas Hulu Migas: Objek Vital Nasional', 'Yogyakarta- Semua fasilitas dan kegiatan hulu minyak dan gas bumi (migas) merupakan objek vital nasional karena sektor ini merupakan salah satu penyumbang devisa terbesar. Hal ini disampaikan Kepala Perwakilan SKK Migas', '<p><br /></p>', 'Fasilitas Hulu Migas: Objek Vital Nasional', 'Yogyakarta- Semua fasilitas dan kegiatan hulu minyak dan gas bumi (migas) merupakan objek vital nasional karena sektor ini merupakan salah satu penyumbang devisa terbesar. Hal ini disampaikan Kepala Perwakilan SKK Migas', '<p><br /></p>', 'http://www.skkmigas.go.id/fasilitas-hulu-migas-objek-vital-nasional', 1, 49, 94, NULL, '0004-08-15 10:40:00', NULL),
(63, '5524a3b792ee4.png', 'INDUSTRI HULU MIGAS PASOK GAS UNTUK TRANSPORTASI', 'Jakarta???Industri hulu minyak dan gas bumi (migas) kembali menunjukkan komitmennya untuk mendukung program konversi bahan bakar minyak (BBM) menjadi bahan bakar gas (BBG) yang digagas pemerintah.', '<p><br /></p>', 'INDUSTRI HULU MIGAS PASOK GAS UNTUK TRANSPORTASI', 'Jakarta???Industri hulu minyak dan gas bumi (migas) kembali menunjukkan komitmennya untuk mendukung program konversi bahan bakar minyak (BBM) menjadi bahan bakar gas (BBG) yang digagas pemerintah.', '<p><br /></p>', 'http://www.skkmigas.go.id/industri-hulu-migas-pasok-gas-untuk-transportasi', 1, 50, 94, NULL, '0004-08-15 10:42:00', NULL),
