(66, '5525fefb9099a.jpg', 'PHE ONWJ dan Nusantara Regas Tandatangani Kesepakatan Sharing Fasilitas', 'Jakarta ??? Pertamina Hulu Energi Offshore North West Java (PHE ONWJ), anak perusahaan Pertamina Hulu Energi (PHE), dan Nusantara Regas sepakat sharing fasilitas guna mengalirkan gas hasil regasifikasi gas alam cair (LNG) untuk memasok kebutuhan Perusahaan Listrik Negara (PLN). ', '<p><br /></p>', 'PHE ONWJ dan Nusantara Regas Tandatangani Kesepakatan Sharing Fasilitas', 'Jakarta ??? Pertamina Hulu Energi Offshore North West Java (PHE ONWJ), anak perusahaan Pertamina Hulu Energi (PHE), dan Nusantara Regas sepakat sharing fasilitas guna mengalirkan gas hasil regasifikasi gas alam cair (LNG) untuk memasok kebutuhan Perusahaan Listrik Negara (PLN). ', '<p><br /></p>', 'http://www.skkmigas.go.id/phe-onwj-dan-nusantara-regas-tandatangani-kesepakatan-sharing-fasilitas', 1, 53, 94, NULL, '0004-09-15 11:24:00', NULL),
(67, '5525ff476c040.jpg', 'Mentari Pembuang Int Siap Eksplorasi di Kabupaten Seruyan', 'Seruyan???Kontraktor Kontrak Kerja Sama (Kontraktor KKS) Mentari Pembuang Int. siap melakukan survei seismik di Wilayah Kerja Seruyan, Kalimantan Tengah. Hal ini disampaikan Kontraktor KKS tersebut dalam kunjungan ke Pemerintah Daerah Kabupaten Seruyan', '<p><br /></p>', 'Mentari Pembuang Int Siap Eksplorasi di Kabupaten Seruyan', 'Seruyan???Kontraktor Kontrak Kerja Sama (Kontraktor KKS) Mentari Pembuang Int. siap melakukan survei seismik di Wilayah Kerja Seruyan, Kalimantan Tengah. Hal ini disampaikan Kontraktor KKS tersebut dalam kunjungan ke Pemerintah Daerah Kabupaten Seruyan', '<p><br /></p>', 'http://www.skkmigas.go.id/mentari-pembuang-int-siap-eksplorasi-di-kabupaten-seruyan', 1, 54, 94, NULL, '0004-09-15 11:25:00', NULL),
(68, '5525ff88832ea.jpg', 'Eksplorasi Demi Anak Cucu', 'Generasi saat ini bisa menikmati migas berkat kegiatan eksplorasi generasi sebelumnya. Semua pihak patut mendukung eksplorasi supaya migas tetap tersedia bagi anak cucu di masa datang', '<p><br /></p>', 'Eksplorasi Demi Anak Cucu', 'Generasi saat ini bisa menikmati migas berkat kegiatan eksplorasi generasi sebelumnya. Semua pihak patut mendukung eksplorasi supaya migas tetap tersedia bagi anak cucu di masa datang', '<p><br /></p>', 'http://www.skkmigas.go.id/eksplorasi-demi-anak-cucu', 1, 55, 94, NULL, '0004-09-15 11:26:00', NULL),
