(70, '5526000ca5843.jpg', 'TNI ANGKATAN DARAT SIAP AMANKAN ASET MIGAS MILIK NEGARA', 'Jakarta ??? Tentara Nasional Indonesia Angkatan Darat (TNI AD) siap mengamankan aset dan fasilitas minyak dan gas bumi yang merupakan milik Negara. Dukungan tersebut diberikan mengingat semakin banyak aset dan fasilitas minyak dan gas bumi yang diganggu di wilayah Indonesia. ', '<p><br /></p>', 'TNI ANGKATAN DARAT SIAP AMANKAN ASET MIGAS MILIK NEGARA', 'Jakarta ??? Tentara Nasional Indonesia Angkatan Darat (TNI AD) siap mengamankan aset dan fasilitas minyak dan gas bumi yang merupakan milik Negara. Dukungan tersebut diberikan mengingat semakin banyak aset dan fasilitas minyak dan gas bumi yang diganggu di wilayah Indonesia. ', '<p><br /></p>', 'http://www.skkmigas.go.id/tni-angkatan-darat-siap-amankan-aset-migas-milik-negara', 1, 57, 94, NULL, '0004-09-15 11:29:00', NULL),
