(75, '55274388bdb8b.jpg', '12 KKKS Asing Rugi Rp19 Triliun Cari Cadangan Migas di Laut Dalam Indonesia', 'Jakarta ??? Sebanyak 12 Kontraktor Kontrak Kerja (KKKS) Minyak dan Gas Bumi asing mengalami kerugian hingga US$1,9 miliar atau Rp19 triliun di 16 Blok Eksplorasi di laut dalam akibat gagal mendapatkan cadangan minyak dan gas yang ekonomis. ', '<p><br /></p>', '12 KKKS Asing Rugi Rp19 Triliun Cari Cadangan Migas di Laut Dalam Indonesia', 'Jakarta ??? Sebanyak 12 Kontraktor Kontrak Kerja (KKKS) Minyak dan Gas Bumi asing mengalami kerugian hingga US$1,9 miliar atau Rp19 triliun di 16 Blok Eksplorasi di laut dalam akibat gagal mendapatkan cadangan minyak dan gas yang ekonomis. ', '<p><br /></p>', 'http://www.skkmigas.go.id/12-kkks-asing-rugi-rp19-triliun-cari-cadangan-migas-di-laut-dalam-indonesia', 1, 62, 94, NULL, '0004-10-15 10:29:00', NULL),
(76, '552744a5e3f9b.jpg', ' INPEX Tambah Empat Sumur Di Blok Masela', 'Ambon ??? Kontraktor Kontrak Kerja Sama (Kontraktor KKS), INPEX Masela Ltd., akan melakukan pengeboran tiga sumur delineasi, yaitu Abadi-8, Abadi-9, Abadi-10, dan satu sumur eksplorasi yakni Berkat-1 mulai Juni 2013. Pengeboran dilakukan untuk mendapatkan data geologi, reservoir, dan teknik pengeboran dalam rangka mengoptimalkan tahap pengembangan Lapangan Gas Abadi', '<p><br /></p>', ' INPEX Tambah Empat Sumur Di Blok Masela', 'Ambon ??? Kontraktor Kontrak Kerja Sama (Kontraktor KKS), INPEX Masela Ltd., akan melakukan pengeboran tiga sumur delineasi, yaitu Abadi-8, Abadi-9, Abadi-10, dan satu sumur eksplorasi yakni Berkat-1 mulai Juni 2013. Pengeboran dilakukan untuk mendapatkan data geologi, reservoir, dan teknik pengeboran dalam rangka mengoptimalkan tahap pengembangan Lapangan Gas Abadi', '<p><br /></p>', 'http://www.skkmigas.go.id/inpex-bor-empat-sumur-di-blok-masela', 1, 63, 94, NULL, '0004-10-15 10:33:00', NULL),
(77, '5527463f8d461.jpg', 'KrisEnergy Siap Eksplorasi Blok Udan Emas', 'Kaimana ??? Kontraktor Kontrak Kerja Sama (Kontraktor KKS), KrisEnergy siap mengeksplorasi blok Udan Emas yang terletak di Papua Barat. Mulai Desember 2013 ini, KrisEnergy akan melakukan survei seismik dua dimensi (2D) sepanjang 250 kilometer di wilayah Teluk Arguni dan Arguni Bawah. ', '<p><br /></p>', 'KrisEnergy Siap Eksplorasi Blok Udan Emas', 'Kaimana ??? Kontraktor Kontrak Kerja Sama (Kontraktor KKS), KrisEnergy siap mengeksplorasi blok Udan Emas yang terletak di Papua Barat. Mulai Desember 2013 ini, KrisEnergy akan melakukan survei seismik dua dimensi (2D) sepanjang 250 kilometer di wilayah Teluk Arguni dan Arguni Bawah. ', '<p><br /></p>', 'http://www.skkmigas.go.id/krisenergy-siap-eksplorasi-blok-udan-emas', 1, 64, 94, NULL, '0004-10-15 10:40:00', NULL),
(78, '55274798e442e.png', 'INPEX Alihkan Hak Partisipasi Blok Babar Selaru Pada Pertamina', 'Jakarta ??? INPEX Babar Selaru Ltd. melakukan penandatanganan kerja sama terkait pengelolaan Blok Babar Selaru dengan PT Pertamina Hulu Energi Babar Selaru. INPEX mengalihan hak partisipasi sebesar 15 persen kepada perusahaan plat merah ', '<p><br /></p>', 'INPEX Alihkan Hak Partisipasi Blok Babar Selaru Pada Pertamina', 'Jakarta ??? INPEX Babar Selaru Ltd. melakukan penandatanganan kerja sama terkait pengelolaan Blok Babar Selaru dengan PT Pertamina Hulu Energi Babar Selaru. INPEX mengalihan hak partisipasi sebesar 15 persen kepada perusahaan plat merah ', '<p><br /></p>', 'http://www.skkmigas.go.id/inpex-alihkan-hak-partisipasi-blok-babar-selaru-pada-pertamina', 1, 65, 94, NULL, '0004-10-15 10:46:00', NULL),
(79, '552748561221a.jpg', 'PetroChina Uji Coba Sumur North Klalin 2', 'Sorong ??? Petrochina International (Bermuda) selesai melakukan pengeboran sumur eksplorasi North Klalin 2 (NK-2) di Blok Sorong ??? Petrochina International (Bermuda) Ltd. has finished the drilling for North Klalin 2 exploration wells (NK-2) in Bermuda Block of Sorong', '<p><br /></p>', 'PetroChina Uji Coba Sumur North Klalin 2', 'Sorong ??? Petrochina International (Bermuda) selesai melakukan pengeboran sumur eksplorasi North Klalin 2 (NK-2) di Blok Sorong ??? Petrochina International (Bermuda) Ltd. has finished the drilling for North Klalin 2 exploration wells (NK-2) in Bermuda Block of Sorong', '<p><br /></p>', 'http://www.skkmigas.go.id/petrochina-uji-coba-sumur-north-klalin-2', 1, 66, 94, NULL, '0004-10-15 10:49:00', NULL),
(80, '552748cd50bb6.jpg', 'SKK Migas Gelar Workshop Pengadaan Tanah', 'Makassar ??? SKK Migas bersama kontraktor KKS wilayah Papua Barat dan Maluku menggelar workshop implementasi Undang-Undang Nomor 2 Tahun 2013 tentang Pengadaan Tanah bagi Pembangunan untuk Kepentingan Umum. Kegiatan selama dua hari itu dibuka Deputi Pengendalian Dukungan Bisnis SKK Migas, Gerhard M. Rumeser di Makassar', '<p><br /></p>', 'SKK Migas Gelar Workshop Pengadaan Tanah', 'Makassar ??? SKK Migas bersama kontraktor KKS wilayah Papua Barat dan Maluku menggelar workshop implementasi Undang-Undang Nomor 2 Tahun 2013 tentang Pengadaan Tanah bagi Pembangunan untuk Kepentingan Umum. Kegiatan selama dua hari itu dibuka Deputi Pengendalian Dukungan Bisnis SKK Migas, Gerhard M. Rumeser di Makassar', '<p><br /></p>', 'http://www.skkmigas.go.id/skk-migas-gelar-workshop-pengadaan-tanah', 1, 67, 94, NULL, '0004-10-15 10:51:00', NULL),
(81, '55274907d6a46.jpg', '2500 Rumah Penduduk Menikmati Aliran Listrik Gas Batubara', 'Balikpapan ??? Pemanfaatan Gas Batubara atau Coalbed Methane (CBM) untuk Industri kelistrikan mulai membuahkan hasil. SKK Migas melalui Kontraktor Kontrak Kerjasama (Kontraktor KKS) Vico Indonesia berhasil menyalurkan energi kelistrikan ke sekitar 2500 rumah penduduk di Kalimantan. ', '<p><br /></p>', '2500 Rumah Penduduk Menikmati Aliran Listrik Gas Batubara', 'Balikpapan ??? Pemanfaatan Gas Batubara atau Coalbed Methane (CBM) untuk Industri kelistrikan mulai membuahkan hasil. SKK Migas melalui Kontraktor Kontrak Kerjasama (Kontraktor KKS) Vico Indonesia berhasil menyalurkan energi kelistrikan ke sekitar 2500 rumah penduduk di Kalimantan. ', '<p><br /></p>', 'http://www.skkmigas.go.id/2500-rumah-penduduk-menikmati-aliran-listrik-gas-batubara', 1, 68, 94, NULL, '0004-10-15 10:52:00', NULL),
(82, '55274a32d932a.jpg', 'SKK Migas Gandeng BPN Percepat Pengadaan Tanah', 'Jakarta ??? Satuan Kerja Khusus Pelaksana Kegiatan Usaha Hulu Minyak dan Gas Bumi (SKK Migas) bekerja sama dengan Badan Pertanahan Nasional (BPN) untuk mempercepat pensertifikatan dan penanganan permasalahan tanah aset negara di sektor hulu migas.', '<p><br /></p>', 'SKK Migas Gandeng BPN Percepat Pengadaan Tanah', 'Jakarta ??? Satuan Kerja Khusus Pelaksana Kegiatan Usaha Hulu Minyak dan Gas Bumi (SKK Migas) bekerja sama dengan Badan Pertanahan Nasional (BPN) untuk mempercepat pensertifikatan dan penanganan permasalahan tanah aset negara di sektor hulu migas.', '<p><br /></p>', 'http://www.skkmigas.go.id/skk-migas-gandeng-bpn-percepat-pengadaan-tanah', 1, 69, 94, NULL, '0004-10-15 10:57:00', NULL),
(83, '55274b199f184.jpg', 'Blok Sebuku Mulai Produksi Oktober 2013', 'Jakarta ??? Lapangan Ruby, Blok Sebuku dengan operator Pearl Oil (Sebuku) Ltd., direncanakan mulai produksi gas bumi sebesar 100 juta kaki kubik per hari (MMSCFD) pada Oktober 2013. ???Saat ini proses pengembangan proyek sudah lebih dari 83 persen,?? ', '<p><br /></p>', 'Blok Sebuku Mulai Produksi Oktober 2013', 'Jakarta ??? Lapangan Ruby, Blok Sebuku dengan operator Pearl Oil (Sebuku) Ltd., direncanakan mulai produksi gas bumi sebesar 100 juta kaki kubik per hari (MMSCFD) pada Oktober 2013. ???Saat ini proses pengembangan proyek sudah lebih dari 83 persen,?? ', '<p><br /></p>', 'http://www.skkmigas.go.id/blok-sebuku-mulai-produksi-oktober-2013', 1, 70, 94, NULL, '0004-10-15 11:01:00', NULL),
(84, '55274b9189a72.jpg', 'SKK Migas-KKKS Bantu Banjir Bojonegoro', 'Bojonegoro ??? Banjir yang memporak porandakan warga Bojonegoro selama empat hari membuat simpati banyak elemen masyarakat. Satuan Kerja Khusus Pelaksana Kegiatan Usaha Hulu Minyak dan Gas Bumi (SKK Migas) bersama Kontraktor Kontrak Kerja sama (KKKS) yang beroperasi di Kabupaten Bojonegoro, menyerahkan bantuan 1.400 paket sembako', '<p><br /></p>', 'SKK Migas-KKKS Bantu Banjir Bojonegoro', 'Bojonegoro ??? Banjir yang memporak porandakan warga Bojonegoro selama empat hari membuat simpati banyak elemen masyarakat. Satuan Kerja Khusus Pelaksana Kegiatan Usaha Hulu Minyak dan Gas Bumi (SKK Migas) bersama Kontraktor Kontrak Kerja sama (KKKS) yang beroperasi di Kabupaten Bojonegoro, menyerahkan bantuan 1.400 paket sembako', '<p><br /></p>', 'http://www.skkmigas.go.id/skk-migas-kkks-bantu-banjir-bojonegoro', 1, 71, 94, NULL, '0004-10-15 11:03:00', NULL),
(85, '552936dee6ae9.jpg', 'Kompasiana Blog Competition', 'Pendapat masyarakat tentang upaya peningkatan kapasitas nasional pada kegiatan hulu migas', '<p><br></p>', 'Kompasiana Blog Competition', 'Pendapat masyarakat tentang upaya peningkatan kapasitas nasional pada kegiatan hulu migas', '<p><br></p>', 'http://www.kompasiana.com/blogcompetition/home/skkmigas2', 1, 1, 94, 1, '0004-11-15 09:53:00', '2015-04-11 21:59:42'),
(86, '552939337e28c.jpg', 'Menata Pengelolaan Rantai Suplai Industri Hulu Migas', 'Proses pengadaan barang dan jasa dalam kegiatan usaha hulu minyak dan gas bumi (migas) tidak jarang dipersepsi negatif. Padahal, ada\nproses bisnis yang perlu dilihat dan dipahami bersama. Tugas SKK Migas dalam menjalankan fungsi pengelolaan rantai suplai juga tidak terbatas\npada pengadaan barang dan jasa. Berikut wawancara dengan <b>Kepala Divisi Pengelolaan Rantai Suplai, Hery Margono.</b>', '<p><br></p>', 'Menata Pengelolaan Rantai Suplai Industri Hulu Migas', 'Proses pengadaan barang dan jasa dalam kegiatan usaha hulu minyak dan gas bumi (migas) tidak jarang dipersepsi negatif. Padahal, ada\nproses bisnis yang perlu dilihat dan dipahami bersama. Tugas SKK Migas dalam menjalankan fungsi pengelolaan rantai suplai juga tidak terbatas\npada pengadaan barang dan jasa. Berikut wawancara dengan <b>Kepala Divisi Pengelolaan Rantai Suplai, Hery Margono.</b>', '<p><br></p>', 'http://4ef69f972526a2d0d0ca-179315b2fd10c686c84912f33917884a.r54.cf6.rackcdn.com/NEWS/BUMI_2014_05_17_HM.pdf', 1, 1, 1, 1, '2015-04-11 15:43:32', '2015-04-11 22:09:39'),
(87, '552c165f8fe67.jpg', 'Hulu Migas, Lokomotif Tenaga Kerja dan Industri Nasional', 'Oleh: isson khairul (id.linkedin.com/pub/isson-khairul/6b/288/3b1/ - dailyquest.data@gmail.com)\n\nInvestasi di hulu migas, mencapai sekitar Rp 300 triliun per tahun. Sampai tahun 2012, sekitar 25.000 orang tenaga kerja nasional, sudah diserap industri hulu migas. Rata-rata, pertambahan tenaga kerja nasional di industri hulu migas, sekitar 1.070 orang per tahun.', '<p><br /></p>', 'Hulu Migas, Lokomotif Tenaga Kerja dan Industri Nasional', 'Oleh: isson khairul (id.linkedin.com/pub/isson-khairul/6b/288/3b1/ - dailyquest.data@gmail.com)\n\nInvestasi di hulu migas, mencapai sekitar Rp 300 triliun per tahun. Sampai tahun 2012, sekitar 25.000 orang tenaga kerja nasional, sudah diserap industri hulu migas. Rata-rata, pertambahan tenaga kerja nasional di industri hulu migas, sekitar 1.070 orang per tahun.', '<p><br /></p>', 'http://ekonomi.kompasiana.com/bisnis/2015/04/03/hulu-migas-lokomotif-tenaga-kerja-dan-industri-nasional-710508.html', 1, 2, 1, NULL, '2015-04-14 02:17:51', NULL),
(88, '552c16930f37b.jpg', 'Gandeng TKI Bersama Industri Kegiatan Hulu Migas Demi Pencapaian Kesejahteraan Bangsa', 'Senang saat ada Kompasiana Nangkring bagian dua “Peningkatan Peran SDM dan Industri dalam Negeri pada Kegiatan Hulu Migas” yang mengupas tuntas kembali seputar Satuan Kerja Khusus Pelaksana Kegiatan Usaha Hulu Minyak dan Gas Bumi (SKK Migas).', '<p><br /></p>', 'Gandeng TKI Bersama Industri Kegiatan Hulu Migas Demi Pencapaian Kesejahteraan Bangsa', 'Senang saat ada Kompasiana Nangkring bagian dua “Peningkatan Peran SDM dan Industri dalam Negeri pada Kegiatan Hulu Migas” yang mengupas tuntas kembali seputar Satuan Kerja Khusus Pelaksana Kegiatan Usaha Hulu Minyak dan Gas Bumi (SKK Migas).', '<p><br /></p>', 'http://ekonomi.kompasiana.com/bisnis/2015/04/04/gandeng-tki-bersama-industri-kegiatan-hulu-migas-demi-pencapaian-kesejahteraan-bangsa-710558.html', 1, 2, 1, NULL, '2015-04-14 02:18:43', NULL),
(89, '552c174adbd48.jpg', 'Upaya Peningkatan Kualitas SDM Hulu Migas', 'Saya tidak pernah membayangkan jika dalam kegiatan industri hulu migas memerlukan peran porter eksplorasi seperti Pak Sugito. Saya hanya tahu jika dalam kegiatan hulu migas pasti banyak tenaga ahli yang bekerja seperti ahli geologi', '<p><br></p>', 'Upaya Peningkatan Kualitas SDM Hulu Migas', 'Saya tidak pernah membayangkan jika dalam kegiatan industri hulu migas memerlukan peran porter eksplorasi seperti Pak Sugito. Saya hanya tahu jika dalam kegiatan hulu migas pasti banyak tenaga ahli yang bekerja seperti ahli geologi', '<p><br></p>', 'http://ekonomi.kompasiana.com/bisnis/2015/04/05/upaya-peningkatan-kualitas-sdm-hulu-migas-710287.html', 1, 2, 1, 1, '2015-04-14 02:19:28', '2015-04-14 02:21:46');
